// ==UserScript==
// @name         Alerta de Lucro/Prejuízo para Bots da Bybit
// @namespace    http://tampermonkey.net/
// @version      1.3
// @description  Monitora o lucro/prejuízo de cada trading bot na Bybit e dispara alertas visuais/sonoros ao atingir metas.
// @author       Seu Nome
// @match        https://www.bybit.com/en/tradingbot/my-bot/
// @match        https://www.bybit.com/*/tradingbot/my-bot/
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_addStyle
// ==/UserScript==

(function() {
    'use strict';

    // --- Variáveis de Configuração e Estado ---
    const KEY_META_LUCRO = 'bybit_metaLucro';
    const KEY_LIMITE_PERDA = 'bybit_limitePerda';

    let metaLucro = GM_getValue(KEY_META_LUCRO, '');
    let limitePerda = GM_getValue(KEY_LIMITE_PERDA, '');

    let estadoAlertaBots = {};

    const SOM_ALERTA_LUCRO = 'data:audio/mpeg;base64,';
    const SOM_ALERTA_PERDA = 'data:audio/mpeg;base64,';

    let audioContextAtivado = false;

    console.log("Script Bybit Bot Monitor iniciado (v1.3).");

    // --- Funções de Utilitário ---

    function tocarSom(url) {
        if (!url) return; // Não toca se a URL estiver vazia
        if (!audioContextAtivado) {
            console.warn("Contexto de áudio não ativado. O som não será tocado.");
            return;
        }
        const audio = new Audio(url);
        audio.play().catch(e => console.error("Erro ao tocar som:", e));
    }

    function ativarContextoAudio() {
        if (audioContextAtivado) return;
        if (!SOM_ALERTA_LUCRO) return; // Não tenta ativar se não houver som
        const audio = new Audio(SOM_ALERTA_LUCRO);
        audio.volume = 0;
        audio.play()
            .then(() => {
                console.log("Contexto de áudio ativado com sucesso!");
                audioContextAtivado = true;
                audio.pause();
            })
            .catch(e => {
                console.warn("Não foi possível ativar o contexto de áudio automaticamente. Necessita interação do usuário.");
            });
    }

    // --- Funções de Interface (Modal de Alerta e Configuração) ---

    function criarModalAlerta() {
        const modalId = 'tm-bybit-alert-modal';
        if (document.getElementById(modalId)) return document.getElementById(modalId);

        const modal = document.createElement('div');
        modal.id = modalId;
        modal.innerHTML = `
            <div class="tm-modal-content">
                <p id="tm-alert-message"></p>
                <button id="tm-alert-ok-button">OK</button>
            </div>
        `;
        document.body.appendChild(modal);

        document.getElementById('tm-alert-ok-button').addEventListener('click', () => {
            modal.style.display = 'none';
        });
        return modal;
    }

    function exibirAlertaPersonalizado(mensagem, tipoAlerta) {
        const modal = criarModalAlerta();
        document.getElementById('tm-alert-message').innerHTML = mensagem;
        modal.style.display = 'flex';

        if (tipoAlerta === 'lucro') {
            tocarSom(SOM_ALERTA_LUCRO);
        } else if (tipoAlerta === 'perda') {
            tocarSom(SOM_ALERTA_PERDA);
        }
        console.log(`Alerta disparado: ${mensagem.replace(/<br>/g, ' ')}`);
    }

    function salvarConfiguracoes() {
        const inputLucro = document.getElementById('inputMetaLucro');
        const inputPerda = document.getElementById('inputLimitePerda');

        metaLucro = inputLucro.value;
        limitePerda = inputPerda.value;

        GM_setValue(KEY_META_LUCRO, metaLucro);
        GM_setValue(KEY_LIMITE_PERDA, limitePerda);

        console.log(`Configurações salvas - Lucro: "${metaLucro}", Perda: "${limitePerda}"`);

        estadoAlertaBots = {};
        console.log("Todos os estados de alerta de bots foram resetados.");
    }

    function criarModalConfiguracao() {
        const modalId = 'tm-bybit-config-modal';
        if (document.getElementById(modalId)) return document.getElementById(modalId);

        const modal = document.createElement('div');
        modal.id = modalId;
        modal.innerHTML = `
            <div class="tm-modal-header" id="tm-modal-header">Configurar Alertas de Bots</div>
            <div class="tm-modal-body">
                <label for="inputMetaLucro">Alertar se o lucro for MAIOR que (ex: 50):</label>
                <input type="number" id="inputMetaLucro" step="any" placeholder="Meta de Lucro (USDT)">
                <label for="inputLimitePerda">Alertar se o prejuízo for MENOR que (ex: -25):</label>
                <input type="number" id="inputLimitePerda" step="any" placeholder="Limite de Perda (USDT)">
                <div class="tm-button-group">
                    <button id="btnSalvarConfig">Salvar</button>
                    <button id="btnFecharConfig">Fechar</button>
                </div>
            </div>
        `;
        document.body.appendChild(modal);

        const inputLucro = document.getElementById('inputMetaLucro');
        const inputPerda = document.getElementById('inputLimitePerda');
        const btnSalvar = document.getElementById('btnSalvarConfig');
        const btnFechar = document.getElementById('btnFecharConfig');

        inputLucro.value = GM_getValue(KEY_META_LUCRO, '');
        inputPerda.value = GM_getValue(KEY_LIMITE_PERDA, '');

        const handleSaveAndClose = () => {
            salvarConfiguracoes();
            modal.style.display = 'none';
        };

        btnSalvar.addEventListener('click', handleSaveAndClose);
        btnFechar.addEventListener('click', () => modal.style.display = 'none');

        // Adiciona evento de 'Enter' para salvar
        inputLucro.addEventListener('keydown', (e) => {
            if (e.key === 'Enter') {
                e.preventDefault();
                handleSaveAndClose();
            }
        });
        inputPerda.addEventListener('keydown', (e) => {
            if (e.key === 'Enter') {
                e.preventDefault();
                handleSaveAndClose();
            }
        });

        criarElementoArrastavel(modal, document.getElementById('tm-modal-header'));
        return modal;
    }

    function criarBotaoConfiguracao() {
        const btnId = 'tm-bybit-open-config-btn';
        if (document.getElementById(btnId)) return;

        const btn = document.createElement('button');
        btn.id = btnId;
        btn.innerHTML = '⚙️ Configurar Alertas';
        document.body.appendChild(btn);

        criarElementoArrastavel(btn, btn, () => {
            const modal = criarModalConfiguracao();
            modal.style.display = 'block';
            ativarContextoAudio();
        });
    }

    function criarElementoArrastavel(elemento, handle, clickCallback = null) {
        let isDragging = false, moved = false;
        let startX, startY, originalX, originalY;
        const DRAG_THRESHOLD = 5;

        handle.addEventListener('mousedown', (e) => {
            isDragging = true;
            moved = false;
            startX = e.clientX;
            startY = e.clientY;
            const rect = elemento.getBoundingClientRect();
            originalX = rect.left;
            originalY = rect.top;

            // Desprende o elemento da borda direita para permitir o arraste livre
            elemento.style.right = 'auto';

            elemento.style.position = 'fixed';
            elemento.style.left = `${originalX}px`;
            elemento.style.top = `${originalY}px`;
            elemento.style.cursor = 'grabbing';
            elemento.style.userSelect = 'none';
        });

        document.addEventListener('mousemove', (e) => {
            if (!isDragging) return;
            e.preventDefault();
            if (Math.abs(e.clientX - startX) > DRAG_THRESHOLD || Math.abs(e.clientY - startY) > DRAG_THRESHOLD) {
                moved = true;
            }
            const newX = originalX + (e.clientX - startX);
            const newY = originalY + (e.clientY - startY);
            elemento.style.left = `${newX}px`;
            elemento.style.top = `${newY}px`;
        });

        document.addEventListener('mouseup', (e) => {
            if (!isDragging) return;
            isDragging = false;
            elemento.style.cursor = 'grab';
            elemento.style.userSelect = '';
            if (!moved && clickCallback) {
                clickCallback();
            }
        });
    }

    // --- Estilos CSS ---
    GM_addStyle(`
        #tm-bybit-config-modal, #tm-bybit-alert-modal {
            display: none; position: fixed; z-index: 100000; background-color: #1A1E2B;
            border: 1px solid #33394E; border-radius: 8px; box-shadow: 0 5px 15px rgba(0,0,0,0.5);
            color: #DDE0E6; font-family: 'Roboto', sans-serif; box-sizing: border-box;
        }
        #tm-bybit-config-modal { top: 20px; right: 20px; width: 320px; }
        #tm-bybit-alert-modal { top: 50%; left: 50%; transform: translate(-50%, -50%); width: 350px; text-align: center; align-items: center; justify-content: center; display: flex; }
        .tm-modal-header { padding: 12px; background-color: #252938; cursor: move; border-top-left-radius: 8px; border-top-right-radius: 8px; font-weight: bold; text-align: center; }
        .tm-modal-body, .tm-modal-content { padding: 20px; display: flex; flex-direction: column; gap: 15px; }
        .tm-modal-content { background-color: #1A1E2B; border-radius: 8px; }
        #tm-bybit-config-modal label { font-size: 14px; color: #9DA1AA; }
        #tm-bybit-config-modal input[type="number"] {
            width: 100%; padding: 10px; border: 1px solid #33394E; border-radius: 4px; background-color: #10131C; color: #DDE0E6; font-size: 16px; box-sizing: border-box;
        }
        #tm-bybit-config-modal .tm-button-group { display: flex; gap: 10px; margin-top: 10px; }
        #tm-bybit-config-modal button, #tm-bybit-alert-modal button {
            flex-grow: 1; padding: 10px 15px; border: none; border-radius: 5px; cursor: pointer; font-size: 14px; font-weight: bold; transition: background-color 0.2s;
        }
        #tm-bybit-config-modal #btnSalvarConfig, #tm-bybit-alert-modal button { background-color: #F7A600; color: #10131C; }
        #tm-bybit-config-modal #btnSalvarConfig:hover, #tm-bybit-alert-modal button:hover { background-color: #FFC552; }
        #tm-bybit-config-modal #btnFecharConfig { background-color: #33394E; color: #DDE0E6; }
        #tm-bybit-config-modal #btnFecharConfig:hover { background-color: #464D69; }
        #tm-bybit-alert-modal p { margin: 0 0 15px 0; font-size: 16px; line-height: 1.5; }
        #tm-bybit-open-config-btn {
            position: fixed; top: 15px; right: 15px; z-index: 99999; background-color: #F7A600; color: #10131C;
            border: none; padding: 8px 12px; border-radius: 5px; cursor: grab; font-size: 14px; font-weight: bold;
            box-shadow: 0 2px 5px rgba(0,0,0,0.3);
        }
    `);

    // --- Lógica Principal de Verificação (Refatorada) ---
    function verificarBotsEAlertar() {
        const botCards = document.querySelectorAll('div.list_card__9aLQX');
        if (botCards.length === 0) return;

        const lucroNum = metaLucro !== '' ? parseFloat(metaLucro) : null;
        const perdaNum = limitePerda !== '' ? parseFloat(limitePerda) : null;

        if (lucroNum === null && perdaNum === null) return;

        botCards.forEach(card => {
            const elLucro = card.querySelector('div.fgrid_profitMark__zLOUL > div:first-child');
            const nomeParEl = card.querySelector('.mainInfo_botTitle__g3x_b > div:first-child');

            if (!elLucro || !nomeParEl) {
                return;
            }

            const lucroAtual = parseFloat(elLucro.innerText.replace('+', ''));
            const nomePar = nomeParEl.innerText.trim();
            const botKey = nomePar;

            if (isNaN(lucroAtual)) return;

            const estadoAtual = estadoAlertaBots[botKey];

            if (lucroNum !== null && lucroAtual >= lucroNum && estadoAtual !== 'alerted-profit') {
                exibirAlertaPersonalizado(`💰 <b>META DE LUCRO ATINGIDA!</b><br>Bot <b>${nomePar}</b> alcançou <b>+${lucroAtual.toFixed(2)} USDT</b>.`, 'lucro');
                estadoAlertaBots[botKey] = 'alerted-profit';
            }
            else if (perdaNum !== null && lucroAtual <= perdaNum && estadoAtual !== 'alerted-loss') {
                exibirAlertaPersonalizado(`🚨 <b>LIMITE DE PERDA ATINGIDO!</b><br>Bot <b>${nomePar}</b> atingiu <b>${lucroAtual.toFixed(2)} USDT</b>.`, 'perda');
                estadoAlertaBots[botKey] = 'alerted-loss';
            }
            else if (
                (lucroNum === null || lucroAtual < lucroNum) &&
                (perdaNum === null || lucroAtual > perdaNum) &&
                estadoAtual
            ) {
                console.log(`Bot ${nomePar} voltou para a zona segura. Alerta resetado.`);
                delete estadoAlertaBots[botKey];
            }
        });
    }

    // --- Inicia o Monitoramento ---
    function iniciarMonitoramento() {
        console.log("Iniciando monitoramento de bots...");
        criarBotaoConfiguracao();
        document.addEventListener('click', ativarContextoAudio, { once: true });
        setInterval(verificarBotsEAlertar, 3000);
    }

    window.addEventListener('load', iniciarMonitoramento);

})();

